import React from 'react';
import SwContext from '../swContex';

function Filtros() {
  return (
    <SwContext.Consumer>
      { ({
        filterByNumericValues,
      }) => (
        <table>

          {
            filterByNumericValues.map((planet, index) => (
              <tr key={ index }>
                { planet.column }
              </tr>
            ))
          }
        </table>
      )}
    </SwContext.Consumer>
  );
}

export default Filtros;
